# ==============================
# METRICS & PERFORMANCE
# ==============================
col1, col2, col3 = st.columns(3)
col1.metric("ðŸ† Best Score", "95.2 %")
col2.metric("â± Inference Time", "1-4 sec")
col3.metric("ðŸ’ª Robustness", "No Overfitting Detected")

# ==============================
# FILE UPLOAD & PREDICTION
# ==============================
st.subheader("ðŸ“Š Run Predictions on Your Data")
uploaded_csv = st.file_uploader("Upload test.csv", type=["csv"])

if uploaded_csv:
    test_df = pd.read_csv(uploaded_csv)
    if "ID" not in test_df.columns:
        st.error("The uploaded CSV must contain an 'ID' column.")
        st.stop()

    feature_cols = [col for col in test_df.columns if col != "ID"]
    predictions = pd.DataFrame({"ID": test_df["ID"]})

    # ==============================
    # Load models directly from Hugging Face Hub
    # ==============================
    model_files = [
        "3_Ensemble_TD_model/BlendProperty1_model.pkl",
        "3_Ensemble_TD_model/BlendProperty2_model.pkl",
        "3_Ensemble_TD_model/BlendProperty3_model.pkl",
        "3_Ensemble_TD_model/BlendProperty4_model.pkl",
        "3_Ensemble_TD_model/BlendProperty5_model.pkl",
        "3_Ensemble_TD_model/BlendProperty6_model.pkl",
        "3_Ensemble_TD_model/BlendProperty7_model.pkl",
        "3_Ensemble_TD_model/BlendProperty8_model.pkl",
        "3_Ensemble_TD_model/BlendProperty9_model.pkl",
        "3_Ensemble_TD_model/BlendProperty10_model.pkl"
        # add more if you uploaded them
    ]

    start_time = time.time()

    for model_file in model_files:
        try:
            st.write(f"ðŸ”¹ Predicting using: {model_file}")
            model_path = hf_hub_download(repo_id=REPO_ID, filename=model_file)
            model = joblib.load(model_path)
            preds = model.predict(test_df[feature_cols])
            target = model_file.replace(".pkl", "")
            predictions[target] = preds
        except Exception as e:
            st.error(f"âŒ Failed to load {model_file}: {e}")

    end_time = time.time()
    inference_duration = round(end_time - start_time, 2)
    st.info(f"â³ Total inference time: {inference_duration} seconds")

    # Save output
    with tempfile.NamedTemporaryFile(delete=False, suffix=".csv") as tmpfile:
        predictions.to_csv(tmpfile.name, index=False)
        st.success("âœ… Predictions generated!")
        st.download_button(
            label="ðŸ“¥ Download Predictions CSV",
            data=open(tmpfile.name, "rb").read(),
            file_name="predictions.csv",
            mime="text/csv"
        )

    # Cache dataframes for interactive visualizations
    st.session_state["predictions_df"] = predictions.copy()
    st.session_state["test_df"] = test_df.copy()

    # ==============================
    # VISUALIZATION CONTROLS (Sidebar)
    # ==============================
    st.sidebar.header("ðŸ›  Visualization Controls")

    row_selector_mode = st.sidebar.radio("Select blend by:", ["Index", "ID"], horizontal=True)
    if row_selector_mode == "Index":
        sel_index = st.sidebar.number_input("Row index (0-based):", min_value=0, max_value=len(predictions) - 1, value=0, step=1)
        row_mask = predictions.index == sel_index
        selected_row_label = f"Index {sel_index}"
    else:
        sel_id = st.sidebar.selectbox("Choose ID", options=predictions["ID"].tolist(), index=0)
        row_mask = predictions["ID"] == sel_id
        selected_row_label = f"ID {sel_id}"

    # The property columns (predicted targets)
    target_cols = [c for c in predictions.columns if c != "ID"]

    if target_cols:
        # Gauge properties selection
        gauge_props = st.sidebar.multiselect(
            "Gauge properties (up to 6 recommended):",
            options=target_cols,
            default=target_cols[: min(6, len(target_cols))]
        )
        st.sidebar.markdown("**Gauge Bounds**")
        gauge_min = st.sidebar.number_input("Min", value=float(np.nan_to_num(predictions[target_cols].min(numeric_only=True).min(), nan=0.0)))
        gauge_max = st.sidebar.number_input("Max", value=float(np.nan_to_num(predictions[target_cols].max(numeric_only=True).max(), nan=1.0)))

        numeric_cols = test_df.select_dtypes(include=[np.number]).columns.tolist()
        default_frac_cols = [c for c in numeric_cols if "fraction" in c.lower()][:3]
        x_col = st.sidebar.selectbox("3D X-axis", options=numeric_cols, index=(numeric_cols.index(default_frac_cols[0]) if default_frac_cols else 0))
        y_col = st.sidebar.selectbox("3D Y-axis", options=numeric_cols, index=(numeric_cols.index(default_frac_cols[1]) if len(default_frac_cols) > 1 else min(1, len(numeric_cols)-1)))
        z_col = st.sidebar.selectbox("3D Z-axis", options=numeric_cols, index=(numeric_cols.index(default_frac_cols[2]) if len(default_frac_cols) > 2 else min(2, len(numeric_cols)-1)))
        color_prop = st.sidebar.selectbox("Color by property", options=target_cols, index=0)

    st.markdown("---")
    st.subheader("ðŸ“ˆ Advanced Visualizations")


    if target_cols:
        sel_row = predictions.loc[row_mask].iloc[0]
        sel_idx = predictions.loc[row_mask].index[0]

        # -----------------------------
        # Radar Chart Normalization
        # -----------------------------
        target_vals = sel_row[target_cols].astype(float)
        mins = predictions[target_cols].min().astype(float)
        maxs = predictions[target_cols].max().astype(float)
        span = (maxs - mins).replace(0, 1)
        normalized = (target_vals - mins) / span
        radar_values = normalized.tolist() + [normalized.tolist()[0]]
        radar_categories = target_cols + [target_cols[0]]

        # -----------------------------
        # Tabs for Visualizations
        # -----------------------------
        tab1, tab2, tab3, tab4 = st.tabs(["Gauges","Radar Chart", "3D Scatter", "Predictions"])

        

        # -----------------------------
        # 1) Gauges
        # -----------------------------
        with tab1:
            if target_cols and gauge_props:
            # Display gauges in responsive columns
                cols_per_row = 3
                rows = (len(gauge_props) + cols_per_row - 1) // cols_per_row
                idxs = predictions.index[predictions.index == predictions.loc[row_mask].index[0]].tolist()
                sel_idx = idxs[0] if idxs else predictions.index[0]
                for r in range(rows):
                    cols = st.columns(cols_per_row)
                    for c in range(cols_per_row):
                        i = r * cols_per_row + c
                        if i >= len(gauge_props):
                            break
                        prop = gauge_props[i]
                        value = float(predictions.loc[sel_idx, prop])
                        with cols[c]:
                            fig_g = go.Figure(go.Indicator(
                                mode="gauge+number",
                                value=value,
                                title={'text': prop},
                                gauge={
                                    'axis': {'range': [gauge_min, gauge_max]},
                                    'bar': {'thickness': 0.3},
                                }
                            ))
                            fig_g.update_layout(height=260, margin=dict(l=15, r=15, t=30, b=10))
                            st.plotly_chart(fig_g, use_container_width=True)
        # -----------------------------
        # 1) Radar Chart
        # -----------------------------
        with tab2:
            st.subheader("Property Radar Chart")
            # Properties = target columns
            properties = target_cols
            sample_preds = predictions.loc[row_mask, target_cols].iloc[0].values.astype(float)
            # Normalize per row
            normalized_values = [(v - min(sample_preds)) / (max(sample_preds) - min(sample_preds)) * 100
                                 if max(sample_preds) != min(sample_preds) else 50  # handle flat lines
                                 for v in sample_preds]
            fig = go.Figure()
            fig.add_trace(go.Scatterpolar(
                r=normalized_values,
                theta=properties,
                fill='toself',
                name='Blend Properties',
                line=dict(color='#ff8a00'),
                fillcolor='rgba(255, 138, 0, 0.5)'
            ))
            
            fig.update_layout(
                polar=dict(radialaxis=dict(visible=True, range=[0, 100])),
                showlegend=False,
                template="plotly_dark",
                height=500
            )
            
            st.plotly_chart(fig, use_container_width=True)

        # -----------------------------
        # 3) 3D Scatter
        # -----------------------------
        with tab3:
            if len(numeric_cols) >= 3:
                viz_df = test_df.copy()
                viz_df[color_prop] = predictions[color_prop].values
                fig3d = px.scatter_3d(viz_df, x=x_col, y=y_col, z=z_col, color=color_prop, hover_data=["ID"])
                fig3d.update_layout(height=650)
                st.plotly_chart(fig3d, use_container_width=True)

        # -----------------------------
        # 4) Predicted Values
        # -----------------------------
        with tab4:
            st.table(predictions.loc[row_mask, target_cols].T.rename(columns={predictions.loc[row_mask].index[0]: 'Predicted Value'}))



